"use strict";(self.webpackChunkspanish_app=self.webpackChunkspanish_app||[]).push([[534],{2534:e=>{e.exports=JSON.parse('{"19":{"words":[{"spanish":"\xbfQu\xe9...?","english":"What...?"},{"spanish":"\xbfC\xf3mo...?","english":"How...?"},{"spanish":"\xbfCu\xe1ndo...?","english":"When...?"},{"spanish":"\xbfD\xf3nde...?","english":"Where...?"},{"spanish":"\xbfPor qu\xe9...?","english":"Why...?"},{"spanish":"\xbfQui\xe9n...?","english":"Who...?"},{"spanish":"\xbfA qu\xe9 te dedicas?","english":"What do you do for a living?"},{"spanish":"Cu\xe9ntame sobre...","english":"Tell me about..."},{"spanish":"\xbfQu\xe9 opinas de...?","english":"What\'s your opinion on...?"},{"spanish":"\xbfQu\xe9 te ha parecido...?","english":"What did you think of...?"},{"spanish":"\xbfQu\xe9 te gusta hacer en tu tiempo libre?","english":"What do you like to do in your free time?"},{"spanish":"\xbfCu\xe1l es tu pel\xedcula favorita?","english":"What is your favorite movie?"},{"spanish":"\xbfCu\xe1l es tu mejor recuerdo de la infancia?","english":"What is your best childhood memory?"},{"spanish":"\xbfQu\xe9 har\xedas si...?","english":"What would you do if...?"},{"spanish":"\xbfHas viajado a...?","english":"Have you traveled to...?"},{"spanish":"\xbfCu\xe1l es el mejor viaje que has hecho?","english":"What is the best trip you have taken?"},{"spanish":"\xbfQu\xe9 has aprendido este a\xf1o?","english":"What have you learned this year?"},{"spanish":"interesante","english":"interesting"},{"spanish":"\xa1Qu\xe9 bien!","english":"How great!"},{"spanish":"\xbfEn serio?","english":"Really?"},{"spanish":"No me digas","english":"No way!, You don\'t say!"},{"spanish":"\xbfY despu\xe9s?","english":"And then?"},{"spanish":"Me gustar\xeda saber m\xe1s","english":"I would like to know more"},{"spanish":"Cu\xe9ntame m\xe1s","english":"Tell me more"},{"spanish":"conversar","english":"to converse"},{"spanish":"compartir","english":"to share"},{"spanish":"El pasatiempo","english":"The hobby"},{"spanish":"La experiencia","english":"The experience"},{"spanish":"La historia","english":"The story"},{"spanish":"La opini\xf3n","english":"The opinion"},{"spanish":"El futuro","english":"The future"},{"spanish":"El pasado","english":"The past"}],"conversations":[{"id":1,"topic":"Conociendo a alguien nuevo","dialog":[{"speaker":"Elena","spanish":"Hola, soy Elena. \xbfQu\xe9 te gusta hacer en tu tiempo libre?","english":"Hello, I\'m Elena. What do you like to do in your free time?"},{"speaker":"Pablo","spanish":"Hola, soy Pablo. Me gusta mucho leer y escuchar m\xfasica. \xbfY a ti?","english":"Hello, I\'m Pablo. I really like to read and listen to music. And you?"},{"speaker":"Elena","spanish":"A m\xed me gusta pintar. Cu\xe9ntame sobre tu m\xfasica favorita.","english":"I like to paint. Tell me about your favorite music."},{"speaker":"Pablo","spanish":"Me gusta la m\xfasica rock de los 80s. \xbfEn serio te gusta pintar?","english":"I like rock music from the 80s. Do you really like to paint?"},{"speaker":"Elena","spanish":"S\xed, es mi pasatiempo favorito. Es muy interesante.","english":"Yes, it\'s my favorite hobby. It\'s very interesting."}],"questions":[{"question":"\xbfQu\xe9 le pregunta Elena a Pablo?","options":["Su nombre","Sus planes para el fin de semana","Sus pasatiempos","Su trabajo"],"answer":"Sus pasatiempos","answerIndex":2},{"question":"\xbfQu\xe9 significa \'Cu\xe9ntame sobre tu m\xfasica favorita\'?","options":["Sing me your favorite music","Tell me about your favorite music","What is your favorite music?","I don\'t like your music"],"answer":"Tell me about your favorite music","answerIndex":1},{"question":"\xbfQu\xe9 le responde Pablo sobre su m\xfasica favorita?","options":["Le gusta la m\xfasica pop","No le gusta la m\xfasica","Le gusta la m\xfasica rock","Le gusta la m\xfasica cl\xe1sica"],"answer":"Le gusta la m\xfasica rock","answerIndex":2}]},{"id":2,"topic":"Hablando de viajes","dialog":[{"speaker":"Carlos","spanish":"\xa1Qu\xe9 bueno verte! \xbfCu\xe1l es el mejor viaje que has hecho?","english":"It\'s good to see you! What is the best trip you have taken?"},{"speaker":"Ana","spanish":"El mejor viaje que he hecho fue a Colombia. \xa1Fue incre\xedble!","english":"The best trip I have taken was to Colombia. It was incredible!"},{"speaker":"Carlos","spanish":"\xbfEn serio? \xbfC\xf3mo fue la experiencia?","english":"Really? How was the experience?"},{"speaker":"Ana","spanish":"La comida era deliciosa y la gente muy amable. \xbfY t\xfa, has viajado mucho?","english":"The food was delicious and the people were very kind. And you, have you traveled much?"},{"speaker":"Carlos","spanish":"S\xed, he viajado a M\xe9xico. Me gustar\xeda saber m\xe1s sobre Colombia.","english":"Yes, I have traveled to Mexico. I would like to know more about Colombia."}],"questions":[{"question":"\xbfQu\xe9 le pregunta Carlos a Ana?","options":["Sobre su trabajo","Sobre el mejor viaje que ha hecho","Sobre su comida favorita","Sobre su familia"],"answer":"Sobre el mejor viaje que ha hecho","answerIndex":1},{"question":"\xbfQu\xe9 significa \'\xbfC\xf3mo fue la experiencia?\'?","options":["How much did it cost?","How was the experience?","When was the experience?","Why was the experience?"],"answer":"How was the experience?","answerIndex":1},{"question":"\xbfQu\xe9 le gust\xf3 a Ana de su viaje a Colombia?","options":["La m\xfasica y el baile","La historia y la cultura","La comida y la gente","Los museos y los parques"],"answer":"La comida y la gente","answerIndex":2}]},{"id":3,"topic":"Opiniones sobre la tecnolog\xeda","dialog":[{"speaker":"Mar\xeda","spanish":"He estado pensando en la tecnolog\xeda. \xbfQu\xe9 opinas de las redes sociales?","english":"I\'ve been thinking about technology. What\'s your opinion on social media?"},{"speaker":"Jos\xe9","spanish":"Creo que son buenas para conectar con personas, pero tambi\xe9n son adictivas.","english":"I think they are good for connecting with people, but they are also addictive."},{"speaker":"Mar\xeda","spanish":"Estoy de acuerdo. \xbfPor qu\xe9 crees que son adictivas?","english":"I agree. Why do you think they are addictive?"},{"speaker":"Jos\xe9","spanish":"Porque siempre queremos ver qu\xe9 est\xe1n haciendo los dem\xe1s. \xa1Qu\xe9 interesante!","english":"Because we always want to see what others are doing. How interesting!"},{"speaker":"Mar\xeda","spanish":"S\xed, me gustar\xeda saber m\xe1s sobre ese tema. Vamos a hablarlo m\xe1s.","english":"Yes, I would like to know more about that topic. Let\'s talk about it more."}],"questions":[{"question":"\xbfQu\xe9 le pregunta Mar\xeda a Jos\xe9?","options":["Sobre su trabajo","Sobre el deporte","Sobre su opini\xf3n de las redes sociales","Sobre su familia"],"answer":"Sobre su opini\xf3n de las redes sociales","answerIndex":2},{"question":"\xbfQu\xe9 significa \'\xbfPor qu\xe9 crees que son adictivas?\'?","options":["Why do you think they are popular?","Why do you think they are addictive?","Why do you think they are good?","Why do you think they are bad?"],"answer":"Why do you think they are addictive?","answerIndex":1},{"question":"\xbfC\xf3mo cree Jos\xe9 que las redes sociales son buenas?","options":["Para ganar dinero","Para conocer gente nueva","Para conectar con personas","Para viajar"],"answer":"Para conectar con personas","answerIndex":2}]},{"id":4,"topic":"Hablando de metas","dialog":[{"speaker":"Diego","spanish":"Hola. \xbfQu\xe9 quieres lograr en el futuro?","english":"Hello. What do you want to achieve in the future?"},{"speaker":"Valeria","spanish":"Quiero ser una artista. Me gustar\xeda viajar y pintar.","english":"I want to be an artist. I would like to travel and paint."},{"speaker":"Diego","spanish":"\xa1Qu\xe9 bien! \xbfC\xf3mo piensas lograrlo?","english":"How great! How do you plan to achieve it?"},{"speaker":"Valeria","spanish":"Quiero ir a la universidad para estudiar arte. \xbfY t\xfa, qu\xe9 quieres hacer?","english":"I want to go to university to study art. And you, what do you want to do?"},{"speaker":"Diego","spanish":"Yo quiero trabajar en marketing. Me gustar\xeda saber m\xe1s sobre tu plan.","english":"I want to work in marketing. I would like to know more about your plan."}],"questions":[{"question":"\xbfQu\xe9 le pregunta Diego a Valeria?","options":["Sobre su pasado","Sobre sus metas futuras","Sobre su trabajo","Sobre su familia"],"answer":"Sobre sus metas futuras","answerIndex":2},{"question":"\xbfQu\xe9 significa \'\xbfC\xf3mo piensas lograrlo?\'?","options":["How do you plan to achieve it?","When will you achieve it?","Where will you achieve it?","Why will you achieve it?"],"answer":"How do you plan to achieve it?","answerIndex":0},{"question":"\xbfQu\xe9 quiere hacer Valeria para lograr sus metas?","options":["Trabajar en marketing","Viajar y pintar","Ser artista","Estudiar arte en la universidad"],"answer":"Estudiar arte en la universidad","answerIndex":3}]},{"id":5,"topic":"Preguntando sobre el pasado","dialog":[{"speaker":"Mario","spanish":"He estado pensando en mi pasado. \xbfCu\xe1l es un recuerdo de tu infancia que te hace feliz?","english":"I\'ve been thinking about my past. What is a memory from your childhood that makes you happy?"},{"speaker":"Camila","spanish":"El recuerdo de jugar con mi abuela en el jard\xedn. Ella era muy graciosa.","english":"The memory of playing with my grandmother in the garden. She was very funny."},{"speaker":"Mario","spanish":"\xa1Qu\xe9 bien! Me gustar\xeda saber m\xe1s de ella.","english":"How great! I would like to know more about her."},{"speaker":"Camila","spanish":"Ella me ense\xf1\xf3 a cocinar. \xbfY t\xfa, qu\xe9 recuerdo tienes?","english":"She taught me how to cook. And you, what memory do you have?"},{"speaker":"Mario","spanish":"El recuerdo de mi perro. \xc9l me hac\xeda re\xedr mucho.","english":"The memory of my dog. He made me laugh a lot."}],"questions":[{"question":"\xbfQu\xe9 le pregunta Mario a Camila?","options":["Un recuerdo de su infancia","Un recuerdo de su trabajo","Un recuerdo de sus amigos","Un recuerdo de su perro"],"answer":"Un recuerdo de su infancia","answerIndex":0},{"question":"\xbfQu\xe9 significa \'Me gustar\xeda saber m\xe1s de ella\'?","options":["I would like to meet her","I would like to know more about her","I don\'t like her","I want to talk to her"],"answer":"I would like to know more about her","answerIndex":1},{"question":"\xbfQu\xe9 le hac\xeda feliz a Mario?","options":["Su abuela","Su perro","Jugar en el jard\xedn","Cocinar"],"answer":"Su perro","answerIndex":1}]}],"stories":[{"id":1,"title":"El Nuevo Compa\xf1ero de Trabajo","sentences":[{"spanish":"Hoy lleg\xf3 un nuevo compa\xf1ero al trabajo. Su nombre es Leo. Quer\xeda conocerlo.","english":"Today a new colleague arrived at work. His name is Leo. I wanted to get to know him."},{"spanish":"Le pregunt\xe9, \'\xbfQu\xe9 te gusta hacer en tu tiempo libre?\'. \xc9l me respondi\xf3 que le gusta hacer senderismo.","english":"I asked him, \'What do you like to do in your free time?\'. He responded that he likes to go hiking."},{"spanish":"Le dije, \'\xa1Qu\xe9 interesante! \xbfCu\xe1l es la mejor ruta que has hecho?\'. Su respuesta fue muy larga y detallada.","english":"I said to him, \'How interesting! What is the best trail you have done?\'. His answer was very long and detailed."},{"spanish":"Me gustar\xeda saber m\xe1s de su vida, as\xed que le pregunt\xe9 por su pasado. Fue una buena conversaci\xf3n.","english":"I would like to know more about his life, so I asked him about his past. It was a good conversation."},{"spanish":"Ahora tengo un nuevo amigo. La clave para conocer a alguien es hacerle buenas preguntas.","english":"Now I have a new friend. The key to getting to know someone is asking them good questions."}]},{"id":2,"title":"Una Cita Interesante","sentences":[{"spanish":"Fui a una cita con una chica llamada Ana. Yo no quer\xeda que fuera aburrida.","english":"I went on a date with a girl named Ana. I didn\'t want it to be boring."},{"spanish":"Le pregunt\xe9, \'\xbfQu\xe9 te gustar\xeda hacer en el futuro?\'. Ella me cont\xf3 sobre sus sue\xf1os.","english":"I asked her, \'What would you like to do in the future?\'. She told me about her dreams."},{"spanish":"Yo le pregunt\xe9, \'\xbfC\xf3mo te sientes sobre...?\'. Ella comparti\xf3 sus opiniones conmigo.","english":"I asked her, \'How do you feel about...?\'. She shared her opinions with me."},{"spanish":"La conversaci\xf3n fluy\xf3 toda la noche. Ana dijo que le gust\xf3 mucho que la escuchara.","english":"The conversation flowed all night. Ana said that she really liked that I listened to her."},{"spanish":"Pienso que las buenas preguntas son m\xe1s importantes que hablar de uno mismo.","english":"I think that good questions are more important than talking about oneself."}]},{"id":3,"title":"La Reuni\xf3n Familiar","sentences":[{"spanish":"Estaba en una reuni\xf3n familiar. Vi a mi primo, quien no hab\xeda visto en a\xf1os.","english":"I was at a family reunion. I saw my cousin, whom I hadn\'t seen in years."},{"spanish":"Le pregunt\xe9, \'\xbfQu\xe9 has aprendido este a\xf1o?\'. \xc9l me cont\xf3 sobre su nuevo trabajo.","english":"I asked him, \'What have you learned this year?\'. He told me about his new job."},{"spanish":"Despu\xe9s, le pregunt\xe9, \'\xbfQu\xe9 opinas de la situaci\xf3n actual?\'. Tuvimos una conversaci\xf3n muy profunda.","english":"Afterwards, I asked him, \'What\'s your opinion on the current situation?\'. We had a very deep conversation."},{"spanish":"Yo sent\xed que nos conectamos de nuevo. Las preguntas me ayudaron a entenderlo mejor.","english":"I felt that we reconnected. The questions helped me understand him better."},{"spanish":"La pr\xf3xima vez que lo vea, voy a preguntar m\xe1s. Es la mejor manera de mantener la conexi\xf3n.","english":"The next time I see him, I\'m going to ask more questions. It\'s the best way to maintain the connection."}]}],"speaking":{"title":"Teniendo Conversaciones","description":"Preguntas y respuestas para iniciar y mantener conversaciones interesantes.","questions_and_answers":[{"question":{"spanish":"\xbfQu\xe9 te gusta hacer en tu tiempo libre?","english":"What do you like to do in your free time?"},"answer":{"spanish":"Me gusta viajar y aprender cosas nuevas.","english":"I like to travel and learn new things."}},{"question":{"spanish":"\xbfCu\xe1l es tu pel\xedcula favorita?","english":"What is your favorite movie?"},"answer":{"spanish":"Mi pel\xedcula favorita es \'El Padrino\'. \xbfY la tuya?","english":"My favorite movie is \'The Godfather\'. And yours?"}},{"question":{"spanish":"Cu\xe9ntame sobre tu trabajo.","english":"Tell me about your job."},"answer":{"spanish":"Trabajo como ingeniero de software. Es un trabajo interesante.","english":"I work as a software engineer. It\'s an interesting job."}},{"question":{"spanish":"\xbfQu\xe9 opinas del cambio clim\xe1tico?","english":"What\'s your opinion on climate change?"},"answer":{"spanish":"Creo que es un problema muy serio y debemos hacer algo.","english":"I believe it\'s a very serious problem and we should do something."}},{"question":{"spanish":"\xbfHas viajado a alg\xfan otro pa\xeds?","english":"Have you traveled to any other country?"},"answer":{"spanish":"S\xed, he viajado a Francia y Espa\xf1a.","english":"Yes, I have traveled to France and Spain."}},{"question":{"spanish":"\xbfCu\xe1l es el mejor viaje que has hecho?","english":"What is the best trip you have taken?"},"answer":{"spanish":"El mejor viaje fue a Jap\xf3n. La comida era incre\xedble.","english":"The best trip was to Japan. The food was incredible."}},{"question":{"spanish":"\xbfQu\xe9 has aprendido este a\xf1o?","english":"What have you learned this year?"},"answer":{"spanish":"He aprendido a ser m\xe1s paciente y organizado.","english":"I have learned to be more patient and organized."}},{"question":{"spanish":"\xbfQui\xe9n es tu h\xe9roe o hero\xedna de la vida real?","english":"Who is your real-life hero or heroine?"},"answer":{"spanish":"Mi madre es mi hero\xedna. Ella es muy trabajadora.","english":"My mother is my heroine. She is very hard-working."}},{"question":{"spanish":"\xbfQu\xe9 har\xedas si ganaras la loter\xeda?","english":"What would you do if you won the lottery?"},"answer":{"spanish":"Viajar\xeda por todo el mundo y donar\xeda dinero a la caridad.","english":"I would travel around the world and donate money to charity."}},{"question":{"spanish":"\xbfD\xf3nde te gustar\xeda vivir en el futuro?","english":"Where would you like to live in the future?"},"answer":{"spanish":"Me gustar\xeda vivir en un lugar con clima c\xe1lido.","english":"I would like to live in a place with a warm climate."}},{"question":{"spanish":"\xbfC\xf3mo es tu casa?","english":"What is your house like?"},"answer":{"spanish":"Mi casa es peque\xf1a pero acogedora. Me gusta mucho.","english":"My house is small but cozy. I like it a lot."}},{"question":{"spanish":"Cu\xe9ntame una historia interesante.","english":"Tell me an interesting story."},"answer":{"spanish":"Una vez, vi una pel\xedcula muy graciosa que me hizo re\xedr por d\xedas.","english":"Once, I saw a very funny movie that made me laugh for days."}},{"question":{"spanish":"\xbfQu\xe9 has comido hoy?","english":"What have you eaten today?"},"answer":{"spanish":"Hoy he comido un s\xe1ndwich y una manzana.","english":"Today I have eaten a sandwich and an apple."}},{"question":{"spanish":"\xbfPor qu\xe9 estudias espa\xf1ol?","english":"Why do you study Spanish?"},"answer":{"spanish":"Estudio espa\xf1ol para poder viajar m\xe1s f\xe1cil.","english":"I study Spanish so I can travel more easily."}},{"question":{"spanish":"\xbfQu\xe9 te ha parecido la clase de hoy?","english":"What did you think of today\'s class?"},"answer":{"spanish":"La clase de hoy me ha parecido muy \xfatil.","english":"Today\'s class seemed very useful to me."}},{"question":{"spanish":"Cu\xe9ntame m\xe1s sobre tu familia.","english":"Tell me more about your family."},"answer":{"spanish":"Mi familia es grande. Tengo dos hermanos y una hermana.","english":"My family is big. I have two brothers and one sister."}},{"question":{"spanish":"\xbfQu\xe9 canci\xf3n te gusta m\xe1s?","english":"What song do you like the most?"},"answer":{"spanish":"Me gusta la canci\xf3n \'Havana\' de Camila Cabello.","english":"I like the song \'Havana\' by Camila Cabello."}},{"question":{"spanish":"\xbfQu\xe9 te gustar\xeda hacer este fin de semana?","english":"What would you like to do this weekend?"},"answer":{"spanish":"Me gustar\xeda ir al parque a leer un libro.","english":"I would like to go to the park to read a book."}},{"question":{"spanish":"\xbfC\xf3mo te sientes sobre tu pasado?","english":"How do you feel about your past?"},"answer":{"spanish":"Me siento bien con mi pasado. Me hizo quien soy hoy.","english":"I feel good about my past. It made me who I am today."}},{"question":{"spanish":"\xbfCu\xe1l es tu mejor recuerdo de la infancia?","english":"What is your best childhood memory?"},"answer":{"spanish":"Mi mejor recuerdo es ir a la playa con mis abuelos.","english":"My best memory is going to the beach with my grandparents."}}]}}}')}}]);